import React from "react";

function Cards(props) {
    return (
        <>
            <div className= "cards">
               <div className= "card">
                  <img src= {props.srcimg}
                       alt= "kitchen-image"
                       className= "card-image"
                  /> 
                  <div className="card-info">
                    <span className= "card-category"> {props.title} </span> 
                  </div>
               </div>
            </div>
        </>
    );
}


export default Cards;
